import './App.css';
import Appbar from "./components/Appbar";
import Person from "./components/Person";
import React from "react";

import bers from "./img/bers.jpg"

function App() {
    return (
        <div className="body" style={{backgroundImage:`url(${bers})`}}>
            <Appbar />
            <Person />
        </div>
    );
}

export default App;
